import { html } from "lit-html";
import "@holochain-open-dev/file-storage/dist/elements/show-image.js";
import "@holochain-open-dev/file-storage/dist/elements/file-storage-context.js";
import { FileStorageZomeMock } from "@holochain-open-dev/file-storage/dist/mocks.js";
import { FileStorageClient } from "@holochain-open-dev/file-storage";

const mock = new FileStorageZomeMock();

const client = new FileStorageClient(mock);
const image =
  "data:image/png;base64,";
function dataURLtoFile(dataurl, filename) {
  var arr = dataurl.split(","),
    mime = arr[0].match(/:(.*?);/)[1],
    bstr = atob(arr[1]),
    n = bstr.length,
    u8arr = new Uint8Array(n);

  while (n--) {
    u8arr[n] = bstr.charCodeAt(n);
  }

  return new File([u8arr], filename, { type: mime });
}
const hash = await client.uploadFile(dataURLtoFile(image, "image.png"));

// More on how to set up stories at: https://storybook.js.org/docs/7.0/web-components/writing-stories/introduction
export default {
  title: "Frontend/Elements/show-image",
  tags: ["autodocs"],
  component: "show-image",
  render: (args) =>
    html`<file-storage-context .client=${new FileStorageClient(mock)}>
      <show-image
        .imageHash=${hash}
        style="width: 80px; height: 80px"
      ></show-image>
    </file-storage-context>`,
};

// More on writing stories with args: https://storybook.js.org/docs/7.0/web-components/writing-stories/args
export const Demo = {};
